import React, { useContext, useEffect, useState } from 'react';
import { UserContext } from '../../App';


const Orders = () => {
    const [loggedInUser, setLoggedInUser] = useContext(UserContext);
    const [orders, setOrders] = useState([]);


    useEffect(() =>{
        fetch('http://localhost:5055/orders?email=' +loggedInUser)
        .then(res => res.json())
        .then(data => setOrders(data));
    },[])

    return (
        <div>
            <h1> Your Recent Orders are here.. </h1>
            <h3> {loggedInUser.name} {orders.email} You have: {orders.length} orders </h3>
            {
                orders.map(order => <li> {order.email}  {order.name} from: {(new Date(order.pickedDate).toDateString('dd/MM/yyyy'))} </li> )
            }
        </div>
    );
};

export default Orders;
